import React from 'react'
import BasketItem from './BasketItem'

export default function BasketList(props) {
    const {order}=props
  return (
    <div className='container'>
        <div className='row'>
            <div className="col s6 l4 m6">

            </div>

        </div>
        {
            order.length ? 
            <table>
            <thead>
                <tr>
                    <th>No</th>
                    <th>Product</th>
                    <th>action</th>
                    <th>Price</th>
                    <th>Delete</th>
                </tr>
            </thead>
            <tbody>
                {
                   order.map((item,index)=>{
                       return(
                        <BasketItem index={index} key={item.id} {...item} />
                       )
                   }) 
                }

            </tbody>
        </table>
        :  <h4>Items not found</h4>
        }

    </div>
  )
}
